column8:
メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【aircorno005】AIRCORNO エアコルノ005<br>
<br>
シンプルでスタイリッシュな天井用4灯シーリングライト。<br>
ヒンジとスポットライトの角度調整は自由自在<br>
シルバーのボディ×ブラックのセードがクールでオシャレ。<br>
口金はGU10、35Wの電球に対応。LED電球もお使いいただけます。<br>
<br>
【特徴】<br>
・スタイリッシュな天井用4灯シーリングライト。<br>
・ブラックのセードがアクセント。<br>
・シルバーのボディがシンプルモダンでオシャレ。<br>
・省エネ、長寿命なLED電球対応。<br>
・定格消費電力は最大約140W(35W×4) 。<br>
<br>
シルバーのボディとブラックのセードがクールでスタイリッシュな天井用4灯シーリングライト。<br>
リビングや寝室をモダンでオシャレに。<br>
LED電球にも対応で経済的！<br>
ヒンジは360°回転、4灯のスポットライトは上下左右自由自在、お好みの場所を照らします！<br>
一般的な引掛シーリング対応なのですぐにご使用いただけます。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>
※電球、本体取り付け用ドライバーは付属しておりません。<br>
※電球はφ50mm以下のものをご使用ください。<br>
※調光、調色電球や、調光式の壁スイッチは故障の原因になりますのでお使いいただけません。<br>
<br>
規格<br>
サイズ：約H760×H160×D130mm<br>
電源：AC100～240V 50Hz/60Hz <br>
定格消費電力：最大140W(35W×4) <br>
重さ：約1.2kg<br>
素材：鉄<br>
セット内容：本体×1、電球用キャッチヘッド×1<br>
